      | 54331 -> { ItemTypeData.id= 54331; name= "Republic Stellar Observatory"; published= false; description= "This Republic Stellar Observatory uses standard technology developed by CONCORD, and is being operated by the Minmatar Republic as part of its efforts in support of the New Eden Common Defense Initiative. Even though EDENCOM co-ordinates the overall defense of stellar systems across the cluster, the core empires are committing their fleets to supporting the defense and fortification efforts. Republic forces are manning and defending Stellar Observatories across Minmatar territory.    The Stellar Observatory is carrying out vital work monitoring the star for signs of Triglavian stellar manipulation and aiding in the formulation of defensive operations in the system. While the Triglavian interest in stars makes the work dangerous, it is vital to the defense of New Eden. EDENCOM and the core empires are dedicating considerable resources and personnel to this effort."; marketGroupId= None; groupId= 4033; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 4; value= 1000.000000 }; { DogmaAttributeValueData.attributeId = 263; value= 40000.000000 }; { DogmaAttributeValueData.attributeId = 264; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 10000.000000 }; { DogmaAttributeValueData.attributeId = 267; value= 0.400000 }; { DogmaAttributeValueData.attributeId = 268; value= 0.400000 }; { DogmaAttributeValueData.attributeId = 269; value= 0.550000 }; { DogmaAttributeValueData.attributeId = 270; value= 0.550000 }; { DogmaAttributeValueData.attributeId = 271; value= 0.400000 }; { DogmaAttributeValueData.attributeId = 272; value= 0.400000 }; { DogmaAttributeValueData.attributeId = 273; value= 0.550000 }; { DogmaAttributeValueData.attributeId = 274; value= 0.550000 }; { DogmaAttributeValueData.attributeId = 798; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 1000.000000 }; { DogmaAttributeValueData.attributeId = 162; va