      | 54428 -> { ItemTypeData.id= 54428; name= "Cerberus Dragon Phoenix SKIN"; published= true; description= "Many cultures of New Eden have mythological figures or creatures that share common features with those found elsewhere, even far across the stars on the worlds of different empires. Such a legendary beast, or sometimes pair of creatures, that shows up in many places is the Dragon Phoenix. The various versions of the Dragon Phoenix found across New Eden vary in details but are all known as harbingers of good fortune and symbols of rebirth.    The vast Gallente Federation, with its myriad cultures and states, has many instances of this mythology present in various forms, including versions where the beast is one legendary creature, accounts of twinned creatures, and even one where the 'Dragon' and the 'Phoenix' marry and become one. This myth is far less common among the Caldari, with their Way of the Winds, and the Amarr with their all-pervading monotheistic religion.    Even so, the native traditional Caldari still living on Caldari Prime have an echo of the idea in their ancient myths; the Achura Stargazers translate the notion into certain of their ideas; and certain cult tales of the Khanid may cloak the myth under layers of Amarr religious trappings. For their part, the Minmatar tribes keep a plethora of totemic creatures and tell many fabulous tales in the traditions of their clans and caravans. Creatures akin to the fantastic Dragon Phoenix are quite at home in the animistic and shamanic cultures of the Minmatar."; marketGroupId= Some(2070); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
