      | 54816 -> { ItemTypeData.id= 54816; name= "Expired Extended Capsuleer Day Glamourex Booster"; published= false; description= "This booster has been produced and distributed by Impetus and CONCORD to to celebrate the 17th anniversary of the first independent capsuleer licenses. Working much like the Social skill this highly potent booster provides a 25% bonus to agent, corporation and faction standing increases.    Volatile compounds were used to create this booster, limiting its shelf life. It will cease to function after June 15, YC122."; marketGroupId= None; groupId= 303; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 438; value= 25.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 330; value= 259200000.000000 }; { DogmaAttributeValueData.attributeId = 277; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 182; value= 3355.000000 }; { DogmaAttributeValueData.attributeId = 2422; value= 18428.457639 }; { DogmaAttributeValueData.attributeId = 362; value= 25.000000 }; { DogmaAttributeValueData.attributeId = 1087; value= 12.000000 } |]; dogmaEffects= [| { DogmaEffectValueData.effectId = 407; isDefault = true } |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 54913 -> { ItemTypeData.id= 54913; name= "Nestor Kybernaut Clade SKIN"; published= true; description= "The Triglavian Collective has not been universally opposed by all in New Eden, with subversive elements across New Eden finding something attractive, even uplifting in Zorya Triglav's message of  proving and joining the flow . The radicals of the Internal Triglavian Revolutionary Organization, also known as  Intriguerre , claim that the Triglavian invasion represents  a dynamic moment of challenge and opportunity for posthumanity . Intriguerre's propagandists have released a ship nanocoating displaying allegiance to the Collective under the name  Kybernaut Clade , in reference to the Triglavian term for capsuleers."; marketGroupId= Some(1963); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 55010 -> { ItemTypeData.id= 55010; name= "Men's Project Discovery Cytometry Cap (OLD)"; published= false; description= "In YC122, Project Discovery initiated a biological research program to support efforts against a rapidly-spreading virus affecting space-industrial infrastructure and colonies across New Eden.    Using advanced flow cytometry techniques the new research program harnesses the citizen science efforts of Project Discovery participants. Incorporating the Project Discovery logo into a design to celebrate the cytometry program, this cap marks the wearer as a contributor to this vital effort."; marketGroupId= Some(1943); groupId= 1092; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
      | 55301 -> { ItemTypeData.id= 55301; name= "Devoter Biosecurity Responders SKIN"; published= true; description= "CONCORD Biosecurity Responders are available to be dispatched on emergency call to any space stations, orbital infrastructure or other space-industrial locations in response to disease and pathogen outbreaks of all kinds.  The challenges of maintaining biosecurity against infectious pathogens and other disease vectors in space-based infrastructure are multiplied by the cosmopolition and highly-interconnected nature of New Eden's space industry and trade networks. This long-recognised problem was for many decades dealt with by the empires, nations and corporations of New Eden in a rather piecemeal fashion, with disputes over jurisdiction and differing standards commonly arising.  Following the Kyonoke Crisis of YC119, and the passage of the interstellar  Hope for All Act , CONCORD established Biosecurity Response Teams, and began to build up its capacity and expertise in the fields of epidemiology and disease management. To that end, CONCORD reached out to partners such as the University of Caille's Department of Epidemiology, Hedion University's School of Medicine, the Sisters of EVE, and the Society of Conscious Thought.  Biosecurity Responders are a vital link in any effort to isolate and analyze infectious pathogens spreading through New Eden's space infrastructure, and crucially to prevent spread to planetary populations. Research to develop effective biosecurity methods, treatments and pathogen controls rely on the field research and data provided by the Biosecurity Reponse Teams."; marketGroupId= Some(2073); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
