      | 55786 -> { ItemTypeData.id= 55786; name= "RFS Shara Osali"; published= false; description= "Shara Osali, known as  Mother Osali  to most Vherokior, is the traditional discoverer of a number of Vherokior herbal and medicinal tea blends. Venerated in a number of mythical tales, Mother Osali's rescue of a Voluval shaman from the jaws of a Jade Coast monitor using a soup ladle is a particularly popular story. Shara  Lizardbane  Osali's legendary  Yetamo Pot Pie  is much discussed but very rarely served.    <i> The liberty of our people is solely our responsibility. Tempting as it is to foist this burden upon our well-wishers, we must never forget that the onus of our emancipation rests with us and us alone. For too long, our proud people have been subjugated to the whims of enslavers, forced to endure relentless suffering and humiliation at the hands of people whose motivations, masked though they may be by florid religious claptrap, remain as base and despicable as those of the playground bully. If ever there was a time to rise – if ever there was a time to join hands with our brothers – that time is now. At this exact junction in history we have within our grasp the means to loosen our tormentors' hold and win freedom for our kin. Opportunities are there to be taken. Brothers, we must rise. </i> – Maleatu Shakor, Republic Parliament Head, speaking before the Tribal Council, November 27th, YC 107"; marketGroupId= None; groupId= 226; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 9; value= 100000000.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 8900.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= Some(2906); mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 8900.000000; volume= 0.000000 } |> Some
